"use strict";document.addEventListener("DOMContentLoaded",function(){if(document.querySelector(".faq-item")){var e=document.querySelectorAll(".faq-item");e.forEach(function(t){t.querySelector(".faq-question").addEventListener("click",function(){e.forEach(function(e){e!==t&&e.classList.remove("active")}),t.classList.toggle("active")})})}window.addEventListener("scroll",function(){var e=document.querySelector("#masthead");window.scrollY>30?e.classList.add("fixed-header"):e.classList.remove("fixed-header")})});